class Solution:    def calPoints(self, ops):        """        :type ops: List[str]        :rtype: int        """        nums=[]        for i in range(len(ops)):            if ops[i].isdigit()  or (ops[i][0]=="-" and ops[i][1:].isdigit()):                nums.append(ops[i])            elif ops[i]=="C":                nums.pop()            elif ops[i]=="D":                item=nums[-1]                nums.append(str(2*int(item)))            elif ops[i]=="+":                nums.append(str(int(nums[-1])+int(nums[-2])))        sum1=0        for item in nums:            sum1+=int(item)        return sum1s=Solution()ops=["5","-2","4","C","D","9","+","+"]print(s.calPoints(ops))